import React from 'react'
import Checkbox from './Checkbox';

export default class Options extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
             checked : 'false'
        }
    }

    
    render() {
        return (
            <div>
                <p>
                    <Checkbox />
                    First
            </p>
                <p>
                <Checkbox />
                    Second
            </p>
                <p>
                <Checkbox />
                    Third
            </p>
                <p>
                    {<input type="checkbox" onChange={this.handleCheck} />}
                    Fourth
            </p>
            </div>
        );
    }
}

